function CreateCourse(){const e=$("#CourseFrom").serialize();$.ajax({url:"/api/instructor/CourseEdit/CreateCourse",type:"PUT",data:e,success:function(e){prepareToast("CheckCircle.svg","Success","Course created successfully You will be moved shortly"),setTimeout(()=>{window.location.href="/Instructor/Course/"+e},2e3)},error:function(e){prepareToast("xmark.svg","Error",e.responseJSON.errorMessage)}})}onsubmit=(e=>{e.preventDefault(),CreateCourse()});